import {
  BrowserRouter as Router,
  Switch,
  Route,
  NavLink
} from "react-router-dom";
import routes from './components/NotFound/NotFound';
import './custom.css';

export default class App extends Component {
  static displayName = App.name;

  render() {
    return (
      <Router>
      {/* <Home /> */}
      <div>
      
      <div>
        <Switch>
          { this.showContentMenu(routes)}
        </Switch>
        </div>

      </div>
      </Router>
    );
  }

  showContentMenu =(routes) =>{
var result = null;
if(routes.lenght > 0){
  result = routes.map((routes,index) =>{
return <Route 
key = {index}
path={routes.path}
exact={routes.exact}
component={routes.main} />
  })
}
  }
}
